        GET("/"),
        |req| {
            let message = format!("Hello, World! Version: {}", VERSION);
            HelloWorld { message: message }.to_response()
        }
    );

    server.route(
        GET("/hello/:name"),
        |req, name| {
            let message = format!("Hello, {name}!", name);
            HelloWorld { message: message }.to_response()
        }
    );

    server.run();
}
