app.get('/', (req, res) => {
  res.cookie('myCookie', 'value', {
    httpOnly: true,
    maxAge: 3600000, // expires in one hour
    secure: process.env.NODE_ENV === 'production', // secure only in production
    sameSite: 'strict', // same-site only
  });
  res.send('Hello World!');
});

app.listen(3000, () => {
  console.log('Server started on port 3000');
});
```
In this example, we set a cookie named `myCookie` with a value of `value`. We also set some additional options, such as `httpOnly`, `maxAge`, `secure`, `sameSite`, and more.

The `httpOnly` option makes the cookie inaccessible to client-side scripts such as JavaScript, which helps to prevent cross-site scripting (XSS) attacks.

The `maxAge` option specifies the number of milliseconds until the cookie expires. In this example, the cookie expires in one hour (3600000 milliseconds).

The `secure` option makes the cookie only available via HTTPS connections, which helps to prevent man-in-the-middle (MITM) attacks.

The `sameSite` option specifies the cookie's same-site policy. In this example, we set it to `strict`, which means that the cookie can only be set if the request was made from the same site as the cookie.

You can replace `value` with your own cookie value, and `3000` with the port number you want to use for your server.
